nner" hotrep="hp.guide.docs.1" target="_blank">        <div class="overview-document-body">         <div class="overview-document-info">          <div class="overview-document-text">网站备案</div>          <div class="overview-document-describe">                       为了规范互联网信息服务活动，促进互联网信息服务健康有序发展，根据国务院令第 292 号《互联网信息服务管理办法》和工信部令第 33 号《非经营性互联网信息服务备案管理办法》规定，国家对经营性互联网信息服务实行许可制度，对非经营性互联网信息服务实行备案制度。未取得许可或者未履行备案手续的，不得从事互联网信息服务，否则就属于违法行为。                     </div>         </div>        </div>       </a>      </div>                    <div class="overview-grid-item">       <a href="//cloud.tencent.com/document/product/436" class="overview-grid-item-inner" hotrep="hp.guide.docs.2" target="_blank">        <div class="overview-document-body">         <div class="overview-document-info">          <div class="overview-document-text">对象存储</div>          <div class="overview-document-describe">                       对象存储（Cloud Object Storage，简称：COS）是腾讯云提供的一种存储海量文件的分布式存储服务，用户可通过网络随时存储和查看数据。腾讯云 COS 使所有用户都能使用具备高扩展性、低成本、可靠和安全的数据存储服务。                     </div>         </div>        </div>       </a>      </div>                    <div class="overview-grid-item">       <a href="//cloud.tencent.com/document/product/215" class="overview-grid-item-inner" hotrep="hp.guide.docs.3" target="_blank">        <div class="overview-document-body">         <div class="overview-document-info">          <div class="overview-document-text">私有网络</div>          <div class="overview-document-describe">                       私有网络（Virtual Private Cloud，VPC）是基于腾讯云构建的专属云上网络空间，为您在腾讯云上的资源提供网络服务，不同私有网络间完全逻辑隔离。作为您在云上的专属网络空间，您可以通过软件定义网络的方式管理您的私有网络 VPC，实现 IP 地址、子网、路由表、网络 ACL 、流日志等功能的配置管理。私有网络还支持多种方式连接 Internet，如弹性 IP 、NAT 网关等，并提供多种计费方式和带宽包帮您节约成本。同时，您也可以通过 VPN 连接或专线接入连通腾讯云与您本地的数据中心，灵活构建混合云。                     </div>         </div>        </div>       </a>      </div>                    <div class="overview-grid-item">       <a href="//cloud.tencent.com/document/product/214" class="overview-grid-item-inner" hotrep="hp.guide.docs.4" target="_blank">        <div class="overview-document-body">         <div class="overview-document-info">          <div class="overview-document-text">负载均衡</div>          <div class="overview-document-describe">                       负载均衡（Cloud Load Balancer，CLB）提供安全快捷的流量分配服务，它可以无缝提供分配应用程序流量所需的负载均衡容量，以实现自动分配云中多个 CVM 实例间应用程序的访问流量，让您实现更高水平的应用程序容错能力。                     </div>         </div>        </div>       </a>      </div>            </div>  </div> </div>   <!--使用文档 end-->    <!--精选课程 start-->   <div class="overview-classics-document J-module-quickStart-recommend"><div class="overview-document-title">精选课程</div>   <div class="overview-basis-grid ">   <div class="overview-basis-grid-inner">               <div class="overview-grid-item">       <a href="https://cloud.tencent.com/edu/learning?ADTAG=consl" target="_blank" class="overview-grid-item-inner" hotrep="hp.guide.recommend.1">        <div class="overview-classics-body">         <div class="overview-classics-info">          <div class="overview-classics-img">           <img src="https://imgcache.qq.com/open_proj/proj_qcloud_v2/mc_2014/overview/css/v2/img/img-1.svg">          </div>          <div class="overview-classics-text">           视频课程          </div>          <div class="overview-classics-describe">在线学习中心，专业的云技术学习平台</div>         </div>        </div>       </a>      </div>                    <div class="overview-grid-item">       <a href="https://cloud.tencent.com/developer/labs?from=consoleOverview" target="_blank" class="overview-grid-item-inner" hotrep="hp.guide.recommend.2">        <div class="overview-classics-body">         <div class="overview-classics-info">          <div class="overview-classics-img">           <img src="https://imgcache.qq.com/open_proj/proj_qcloud_v2/mc_2014/overview/css/v2/img/img-2.svg">          </div>          <div class="overview-classics-text">           实践课程          </div>          <div class="overview-classics-describe">动手实验室，开发者专属在线实验平台</div>         </d