>        </a>       </li>                        <li>        <a href="https://cloud.tencent.com/announce/detail/234" class="overview-notice-inner" target="_blank" hotrep="hp.announce.3">         <div class="overview-notice-time"><span>05月04</span></div>         <div class="overview-notice-title">          <div class="overview-notice-title-inner">0504新加坡外网质量问题通知</div>         </div>        </a>       </li>               </ul>     </div> </div></div>      <!--最新公告 end-->       <!--广告 start-->      <div class="overview-ad overview-panel J-module-ads"></div>      <!--广告 end-->       <!--最新发布 start-->      <div class="overview-news overview-panel J-module-productEventList"><div class="overview-panel-inner">  <div class="overview-panel-title">   <div class="overview-title-inner">    <div class="overview-title-text">最新发布</div>    <div class="overview-title-more">     <a href="//cloud.tencent.com/product/events" hotrep="hp.new.more" target="_blank">查看更多</a>    </div>   </div>  </div>  <div class="overview-panel-body">       <ul class="overview-news-list">                  <li>                 <a href="https://cloud.tencent.com/product/svsa" hotrep="hp.new.1" class="overview-news-inner" target="_blank">                  <div class="overview-news-box">           <div class="overview-news-title">短视频结构化分析-短视频结构化分析产品正式上线</div>           <div class="overview-news-text">            短视频结构化分析（Short Video Structured Analysis，SVSA）为您提供最智能的短视频（小视频）分析处理服务。您可通过腾讯领先的视频 AI 技术，对短视频进行全方位分析，提供包括视频多级标签自动生成、视频智能审核、视频智能批处理、相似短视频智能推荐等功能，为短视频及小视频客户提供全方位的视频 AI 服务。           </div>          </div>                 </a>               </li>                        <li>                 <a href="https://cloud.tencent.com/product/ecc" hotrep="hp.new.2" class="overview-news-inner" target="_blank">                  <div class="overview-news-box">           <div class="overview-news-title">英文作文批改ECC-英文作文批改正式上线</div>           <div class="overview-news-text">            英文作文批改是腾讯云推出的英文作文智能批改产品，覆盖学生英语学习全周期，提供高参考价值的智能批改功能，其中批改包含整体点评、分句点评，涉及词汇、词性、句式结构、内容相关性等40余项细评分维度。帮助教师、家长、学生快速修正语法错误，轻松提升作文水平。           </div>          </div>                 </a>               </li>                        <li>                 <a href="https://cloud.tencent.com/product/tmf" hotrep="hp.new.3" class="overview-news-inner" target="_blank">                  <div class="overview-news-box">           <div class="overview-news-title">移动金融开发平台-新产品上线</div>           <div class="overview-news-text">            移动金融开发平台正式发布，该服务为银行、保险、证券、互金等金融客户提供移动应用开发服务。           </div>          </div>                 </a>               </li>               </ul>     </div> </div></div>      <!--最新发布 end-->       <!--热门问答 start-->      <div class="overview-forum overview-panel J-module-hotAskQuestion" style=""><div class="overview-panel-inner">  <div class="overview-panel-title">   <div class="overview-title-inner">    <div class="overview-title-text">云+社区问答</div>   </div>  </div>  <div class="overview-panel-body">   <div class="overview-forum-info">    有疑问，让社区达人来帮你！   </div>  </div>  <div class="overview-panel-foot">   <a target="_blank" href="//cloud.tencent.com/developer/ask" hotrep="hp.ask.more" class="overview-forum-btn">进入问答</a>  </div> </div></div>      <!--热门问答 end-->       <!--mobile 快速入门 start-->      <div class="overview-basis overview-panel mobile-overview-basis J-module-quickStart-mobile"><div class="overview-panel-inner">  <div class="overview-panel-body">   <!--动手实践 start-->   <!--<div class="overview-basis-lab J-module-quickStart-labs"></div>-->   <!--动手实践 end-->    <!--视频教程 start-->   <!--<div class="overview-basis-video J-module-quickStart-video"></div>-->   <!--视频教程 end-->    <!--使用文档 start-->   <div class="overview-basis-document J-module-quickStart-document"><div class="overview-document-title">  <div class="overview-title-inner">   <div class="overview-title-text">使用文档</div>   <div class="overview-title-more">    <a href="https://cloud.tencent.com/document/product" target="_blank" hotrep="hp.docucment.more">查看更多</a>   </div>  </div> </div>   <div class="overview-basis-grid">   <div class="overview-basis-grid-inner">               <div class="overview-grid-item">       <a href="//cloud.tencent.com/document/product/243" class="overview-grid-item-inner" hotrep="hp.guide.docs.1" target="_blank">        <div class="overview-document-body">         <div class="overview-document-info">          <div class="overview-document-text">网站备案</div>          <div class="overview-document-describe">                       为了规范互联网信息服务活动，促进互联网信息服务健康有序发展，根据国务院令第 292 号《互联网信息服务管理办法》和工信部令第 33 号《非经营性互联网信息服务备案管理办法》规定，国家对经营性互联网信息服务实行许可制度，对非经营性互联网信息服务实行备案制度。未取得许可或者未履行备案手续的，不得从事互联网信息服务，否则就属于违法行为。                     </div>         </div>        </div>       </a>      </div>                    <div class="overview-grid-item">       <a href="//cloud.tencent.com/document/product/436" class="overview-grid-item-inner" hotrep="hp.guide.docs.2" target="_blank">        <div class="overview-document-body">         <div class="overview-document-info">          <div class="overview-document-text">对象存储</div>          <div class="overview-document-describe">                       对象存储（Cloud Object Storage，简称：COS）是腾讯云提供的一种存储海量文件的分布式存储服务，用户可通过网络随时存储和查看数据。腾讯云 COS 使所有用户都能使用具备高扩展性、低成本、可靠和安全的数据存储服务。                     </div>         </div>        </div>       </a>      </div>                    <div class="overview-grid-item">       <a href="//cloud.tencent.com/document/product/215" class="overview-grid-item-inner" hotrep="hp.guide.docs.3" target="_blank">        <div class="overview-document-body">         <div class="overview-document-info">          <div class="overview-document-text">私有网络</div>          <div class="overview-document-describe">                       私有网络（Virtual Private Cloud，VPC）是基于腾讯云构建的专属云上网络空间，为您在腾讯云上的资源提供网络服务，不同私有网络间完全逻辑隔离。作为您在云上的专属网络空间，您可以通过软件定义网络的方式管理您的私有网络 VPC，实现 IP 地址、子网、路由表、网络 ACL 、流日志等功能的配置管理。私有网络还支持多种方式连接 Internet，如弹性 IP 、NAT 网关等，并提供多种计费方式和带宽包帮您节约成本。同时，您也可以通过 VPN 连接或专线接入连通腾讯云与您本地的数据中心，灵活构建混合云。                     </div>         </div>        </div>       </a>      </div>                    <div class="overview-grid-item">       <a href="//cloud.tencent.com/document/product/214" class="overview-grid-item-inner" hotrep="hp.guide.docs.4" target="_blank">        <div class="overview-document-body">         <div class="overview-document-info">          <div class="overview-document-text">负载均衡</div>          <div class="overview-document-describe">                       负载均衡（Cloud Load Balancer，CLB）提供安全快捷的流量分配服务，它可以无缝提供分配应用程序流量所需的负载均衡容量，以实现自动分配云中多个 CVM 实例间应用程序的访问流量，让您实现更高水平的应用程序容错能力。                     </div>         </div>        </div>       </a>      </div>            </div>  </div> </div>   <!--使用文档 end-->    <!--精选课程 start-->   <div class="overview-classics-document J-module-quickStart-recommend"><div class="overview-document-title">精选课程</div>   <div class="overview-basis-grid ">   <div class="overview-basis-grid-inner">               <div class="overview-grid-item">       <a href="https://cloud.tencent.com/edu/learning?ADTAG=consl" target="_blank" class="overview-grid-item-inner" hotrep="hp.guide.recommend.1">        <div class="overview-classics-body">         <div class="overview-classics-info">          <div class="overview-classics-img">           <img src="https://imgcache.qq.com/open_proj/proj_qcloud_v2/mc_2014/overview/css/v2/img/img-1.svg">          </div>          <div class="overview-classics-text">           视频课程          </div>          <div class="overview-classics-describe">在线学习中心，专业的云技术学习平台</div>         </div>        </div>       </a>      </div>                    <div class="overview-grid-item">       <a href="https://cloud.tencent.com/developer/labs?from=consoleOverview" target="_blank" class="overview-grid-item-inner" hotrep="hp.guide.recommend.2">        <div class="overview-classics-body">         <div class="overview-classics-info">          <div class="overview-classics-img">           <img src="https://imgcache.qq.com/open_proj/proj_qcloud_v2/mc_2014/overview/css/v2/img/img-2.svg">          </div>          <div class="overview-classics-text">           实践课程          </div>          <div class="overview-classics-describe">动手实验室，开发者专属在线实验平台</div>         </div>        </div>       </a>      </div>                    <div class="overview-grid-item">       <a href="https://cloud.tencent.com/developer/special/microapp?from=consoleOverview" target="_blank" class="overview-grid-item-inner" hotrep="hp.guide.recommend.3">        <div class="overview-classics-body">         <div class="overview-classics-info">          <div class="overview-classics-img">           <img src="https://imgcache.qq.com/open_proj/proj_qcloud_v2/mc_2014/overview/css/v2/img/img-3.svg">          </div>          <div class="overview-classics-text">           小程序·云开发          </div>          <div class="overview-classics-describe">揭秘微信小程序解决方案</div>         </div>        </div>       </a>      </div>            </div>  </div> </div>   <!--精选课程 end-->   </div> </div></div>      <!--mobile 快速入门 end-->     </div>    </div>     <!--右侧帮助-->    <div class="cont-helpinfo J-module-sideAds mod-scroll-btn"><ul>  <li class="qc-scroll-item qc-sb-item qc-sb-service-link qc-scroll-item-buy J-adv-item" style="display:none">   <a href="https://cloud.tencent.com/act/mid-year?from=consoletoolbar" class="qc-scroll-img" target="_blank" title="年中特惠" hotrep="hp.sidebar.season">    <img src="https://main.qcloudimg.com/raw/1d02103ebfbe9482c3a7716492668457.jpg" alt="年中特惠">   </a>  </li>   <li class="qc-scroll-item qc-scroll-item-vip qc-sb-item qc-sb-service-link J-ovSidebarVIP" style="display: none;">   <div class="tc-15-bubble-icon tc-15-triangle-align-start">    <i class="qc-scroll-item-vip-icon"></i>   </div>  </li>   <li class="qc-scroll-item qc-scroll-item-400 qc-sb-item qc-sb-service-link">   <div class="tc-15-bubble-icon tc-15-triangle-align-start">    <i class="qc-scroll-item-400-icon"></i>    <div class="tc-15-bubble tc-